css:
.git-control .icon {
  width: 100%;
}
.git-control .icon:before {
  margin-right: 5px;
  position: relative;
  top: 1px;
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  text-align: center;
  text-decoration: none;
  font-size: 16px;
  line-height: 24px;
  height: 16px;
  width: 16px;
  -webkit-font-smoothing: antialiased;
}
.git-control .icon.large:before {
  top: 0px;
  font-size: 24px;
  line-height: 24px;
  height: 24px;
  width: 100%;
  margin-right: 0;
}
.git-control .icon.branch:before {
  content: '\f020';
}
.git-control .icon.check:before {
  content: '\f03a';
}
.git-control .icon.chevron-down:before {
  content: '\f0a3';
}
.git-control .icon.chevron-right:before {
  content: '\f078';
}
.git-control .icon.clone:before {
  content: '\f04c';
}
.git-control .icon.commit:before {
  content: '\f01f';
}
.git-control .icon.compare:before {
  content: '\f0ac';
}
.git-control .icon.cloud-download:before {
  content: '\f00b';
}
.git-control .icon.cloud-upload:before {
  content: '\f00c';
}
.git-control .icon.dash:before {
  content: '\f0ca';
}
.git-control .icon.flame:before {
  content: '\f0d2';
}
.git-control .icon.forked:before {
  content: '\f002';
}
.git-control .icon.merge:before {
  content: '\f023';
}
.git-control .icon.flow:before {
  content: '\f0c6';
}
.git-control .icon.plus:before {
  content: '\f05d';
}
.git-control .icon.pull:before {
  content: '\f006';
}
.git-control .icon.pulse:before,
.git-control .icon.file-modified:before {
  content: '\f085';
}
.git-control .icon.push:before {
  content: '\f005';
}
.git-control .icon.question:before,
.git-control .icon.file-new:before {
  content: '\f02c';
}
.git-control .icon.square:before {
  content: '\f053';
}
.git-control .icon.sync:before {
  content: '\f087';
}
.git-control .icon.tag:before {
  content: '\f015';
}
.git-control .icon.trash:before {
  content: '\f0d0';
}
.git-control .icon.versions:before,
.git-control .icon.file-conflict:before {
  content: '\f064';
}
.git-control .icon.x:before,
.git-control .icon.file-deleted:before {
  content: '\f081';
}
